function debounce(func, wait, immediate) {
	var timeout, result;

	return function() {
		var self, args, callNow;

		function later () {
			timeout = null;

			if (!immediate)
				result = func.apply(self, args);
		}

		self = this;
		args = arguments;
		callNow = immediate && !timeout;

		clearTimeout(timeout);
		timeout = setTimeout(later, wait);

		if (callNow)
			result = func.apply(self, args);

		return result;
	}
}


