/*
---
name: urlTokeniser
description: Makes the URL query string available
http://stackoverflow.com/questions/979975/how-to-get-the-value-from-the-url-parameter
provides: queryString
...
*/

function urlTokeniser (query) {
	// This function is anonymous, is executed immediately and
	// the return value is assigned to urlTokeniser!
	if (query === '')
		return false;

	var qS = {};
	var vars = query.split("&");

	for (var i = 0; i < vars.length; i++) {
		var pair = vars[i].split("=");
			
		if (typeof qS[pair[0]] === "undefined") { // If first entry with this name
			qS[pair[0]] = pair[1];
		}
		else if (typeof qS[pair[0]] === "string") { // If second entry with this name
			var arr = [ qS[pair[0]], pair[1] ];
			qS[pair[0]] = arr;
		}
		else { // If third or later entry with this name
			qS[pair[0]].push(pair[1]);
		}
	}

	return qS;
}

var queryString = urlTokeniser(window.location.search.substring(1));


/*
---
name: onReady
description: Checks for the dom being ready and loaded
http://javascript.info/tutorial/onload-ondomcontentloaded
provides: onReady
...
*/

function bindReady(handler){

	var called = false

	function ready() {
		if (called) return
		called = true
		handler()
	}

	if ( document.addEventListener ) { // native event
		document.addEventListener( "DOMContentLoaded", ready, false )
	}
	else if ( document.attachEvent ) {	// IE
		try {
			var isFrame = window.frameElement != null
		} catch(e) {}

		// IE, the document is not inside a frame
		if ( document.documentElement.doScroll && !isFrame ) {
			function tryScroll(){
				if (called) return
				try {
					document.documentElement.doScroll("left")
					ready()
				} catch(e) {
					setTimeout(tryScroll, 10)
				}
			}
			tryScroll()
		}

		// IE, the document is inside a frame
		document.attachEvent("onreadystatechange", function(){
			if ( document.readyState === "complete" ) {
				ready()
			}
		})
	}

	// Old browsers
	if (window.addEventListener)
			window.addEventListener('load', ready, false)
	else if (window.attachEvent)
			window.attachEvent('onload', ready)
	else {
		var fn = window.onload // very old browser, copy old onload
		window.onload = function() { // replace by new onload and call the old one
			fn && fn()
			ready()
		}
	}
}

var readyList = []

function onReady(handler) {
	
	function executeHandlers() {
		for(var i=0; i<readyList.length; i++) {
			readyList[i]()
		}
	}

	if (!readyList.length) { // set handler on first run
		bindReady(executeHandlers)
	}

	readyList.push(handler)
}


/*
---
name: getViewportSize
description: Gets the dimensions of the viewport
...
*/

function getViewportSize() {
	var dims = {};
	dims.width = 0;
	dims.height = 0;

	if( typeof( window.innerWidth ) == 'number' ) {
		//Non-IE
		dims.width = window.innerWidth;
		dims.height = window.innerHeight;
	}
	else if( document.documentElement && ( document.documentElement.clientWidth || document.documentElement.clientHeight ) ) {
		//IE 6+ in 'standards compliant mode'
		dims.width = document.documentElement.clientWidth;
		dims.height = document.documentElement.clientHeight;
	}
	else if( document.body && ( document.body.clientWidth || document.body.clientHeight ) ) {
		//IE 4 compatible
		dims.width = document.body.clientWidth;
		dims.height = document.body.clientHeight;
	}

	return dims;
}


/*
---
name: getElementBoxModel
description: Gets the dimensions and position of any element
...
*/

function getElementBoxModel(element) {
	var dims = {};

	var element_clientTop = element.clientTop;
	var element_offsetTop = element.offsetTop;
	var element_scrollTop = element.scrollTop;

	var element_clientLeft = element.clientLeft;
	var element_offsetLeft = element.offsetLeft;
	var element_scrollLeft = element.scrollLeft;

	var element_clientHeight = element.clientHeight;
	var element_offsetHeight = element.offsetHeight;
	var element_scrollHeight = element.scrollHeight;

	var element_clientWidth = element.clientWidth;
	var element_offsetWidth = element.offsetWidth;
	var element_scrollWidth = element.scrollWidth;

	dims.top = Math.max(element_clientTop, element_offsetTop, element_scrollTop);
	dims.left = Math.max(element_clientLeft, element_offsetLeft, element_scrollLeft);
	dims.height = Math.max(element_clientHeight, element_offsetHeight, element_scrollHeight);
	dims.width = Math.max(element_clientWidth, element_offsetWidth, element_scrollWidth);

	return dims;
}


/*
---
name: reactTabs
description: simple accordion/tabs using Classie
provides: reactTabs
...
*/

function reactTabs (tabs, containers, options) {
	if (typeof options === 'undefined')
		var options = {};

	var initialTab = (typeof options.initialTab !== 'undefined')
		? options.initialTab
		: 0;

	if (typeof tabs !== 'undefined') {
		classie.add(tabs[initialTab], 'active_title');
		classie.add(containers[initialTab], 'active_container');

		for (var i = tabs.length - 1; i >= 0; i--) {
			tabs[i].onclick = function (e) {
				for (var n = tabs.length - 1; n >= 0; n--) {
					classie.remove(tabs[n], 'active_title');
					classie.remove(containers[n], 'active_container');
				};

				classie.add(e.target, 'active_title');
				var id = e.target.getAttribute('data-tab');
				classie.add(document.getElementById(id), 'active_container');
			}
		};
	}
	else
		return false;
}


